import './App.css';
import ComponenteEventos from './componenets/ComponenteEventos';
import ComponenteProps from './componenets/ComponenteProps';
import ComponenteState from './componenets/ComponenteState';
import ComponentePropsType from './componenets/ComponentePropsType';

function App() {
  return (
    <div className="App">
      <h1>Aplicacion inicial REACT</h1>
      <div className="row">
        <div className="col">
          <ComponenteEventos/>
        </div>
        <div className="col">
          <ComponenteProps/>
        </div>
      </div>
      <div className="row">
        <div className="col">
          <ComponenteState/>
        </div>
        <div className="col">
          <ComponentePropsType></ComponentePropsType>
        </div>
      </div>
      </div>
  );
}

export default App;
